import os

import psycopg2

def initdb(username, password, host, port):
    conn = psycopg2.connect(user=username, password=password, \
        host=host, port=port, database='blast_image')
    cur = conn.cursor()
    try:
        cur.execute("select 1 from image")
    except psycopg2.ProgrammingError as e:
        conn.rollback()
        cur = conn.cursor()
        cur.execute("create table image (tag varchar(128), image bytea)")
        cur.execute("insert into image(tag, image) values ('openshift', '')")
        cur.execute("insert into image(tag, image) values ('soltysh', '')")
        cur.execute("insert into image(tag, image) values ('pyconpl', '')")
        conn.commit()
    finally:
        cur.close()
        conn.close()

if __name__ == '__main__':
    if 'BLAST_IMAGE_DB_SERVICE_HOST' in os.environ:
        initdb(os.environ['POSTGRESQL_USER'], \
            os.environ['POSTGRESQL_PASSWORD'], \
            os.environ['BLAST_IMAGE_DB_SERVICE_HOST'], \
            os.environ['BLAST_IMAGE_DB_SERVICE_PORT'])
    else:
        initdb('user', 'password', 'localhost', '5432')

